	var cacisRequestStr = transformMessage(msg, "inboundMsgToCRTransformer");

	cacisRequest = new XML(cacisRequestStr);

	channelMap.put("cacisRequest", cacisRequest);

} catch(err) {
	var intgExcp = new Packages.gov.nih.nci.integration.exception.IntegrationException(Packages.gov.nih.nci.integration.exception.IntegrationError._1041, err, null);
	channelMap.put('CACIS_ERROR', intgExcp);
}

