properties.property:
try {
	var client = globalMap.get("CaCISClient");
	var wsdlUrl = globalMap.get("CaCISWsdlUrl");

	var cacisResponse = client.acceptMessage(wsdlUrl, messageObject.getEncodedData());

	logger.info("cacisResponse=" + cacisResponse);
	responseMap.put('caCISRequestSenderConnector', cacisResponse);
} catch(err) {
	logger.debug(err);
	var intgExcp = new Packages.gov.nih.nci.integration.exception.IntegrationException(Packages.gov.nih.nci.integration.exception.IntegrationError._1043, err, null);
	channelMap.put('CACIS_ERROR', intgExcp);
}

return;

