properties.property:
//get all responses from all destinations and constructs a valid response

var cacisError = $('CACIS_ERROR');
if(cacisError) {
	logger.debug("cacisError="+cacisError);
	var iHubResponse =  convertIntgExceptionToIHubResponse(cacisError);

	responseMap.put("ResponseWriterConnector", ResponseFactory.getFailureResponse(iHubResponse));

	return;
}

var cacisResponseObj = responseMap.get('caCISRequestSenderConnector');
var cacisResponse = cacisResponseObj.getMessage();

//var cacisResponse = responseMap.get('caCISRequestSenderConnector');

//TODO: handle cacis response correctly, for now deal with String response
var iHubResponse = null;
logger.debug("cacisResponse in RW="+cacisResponse);
if(cacisResponse.contains("CaCISError")) {

	var cacisErrorRes = new XML(cacisResponse);
	var errCd = cacisErrorRes['@errorCode'].toString();
	var errDesc = cacisErrorRes['@errorMessage'].toString();

	var iHubResponse = "<response><reponseStatus>FAILURE</responseStatus>"
			+ "<caXchangeError><errorCode>"+ errCd +"</errorCode>"
			+ "<errorDescription>" + errDesc + "</errorDescription>"
			+ "</caXchangeError></response>";
	responseMap.put("ResponseWriterConnector", ResponseFactory.getFailureResponse(iHubResponse));
} else {
	var iHubResponse = "<response><reponseStatus>SUCCESS</responseStatus>"
			+ "</response>";
	responseMap.put("ResponseWriterConnector", ResponseFactory.getSuccessResponse(iHubResponse));
}



return;

